import React, { useState, useEffect } from 'react';

function App() {
  const [response, setResponse] = useState('');

  useEffect(() => {
    fetch('/api/message')  // Endpoint from Flask
      .then(res => res.json())
      .then(data => setResponse(data.message));
  }, []);

  return (
    <div>
      <h1>ETE React App</h1>
      <p>{response}</p>
    </div>
  );
}

export default App;
